import Modal from "../UI/Modal";
import "./Cart.css";

function Cart(props) {
  const cartItems = (
    <ul className="cart-items">
      {[].map((items) => (
        <li>{items.name}</li>
      ))}
    </ul>
  );

  return (
    <div>
    <Modal>
      <div className="total">
        <span>Total Amount</span>
        <span>32.0</span>
      </div>
      <div className="actions">
        <button className="button--alt">Close</button>
        <button className="button">Order</button>
      </div>
    </Modal></div>
  );
}
export default Cart;
